import React from "react";
import "../../App.css";
import Cards from "../Cards";
import Footer from "../Footer";
import EventCards from "../EventCards";

export default function About() {
  return (
    <>
      <h3>
        This is a message from Indian Graduate Student Association (IGSA) , for
        those, who deferred their admission to Fall 2022 and all the new
        incoming students for Fall 2022. We would like to add you to the IGSA
        Fall 2022 WhatsApp group, Where you will get along with all the Fall'22
        students and also interact with our members to clear all your doubts
        regarding accommodation, airport pickup, admission process, and academic
        resources. We will have many online informative sessions.
      </h3>
      <Footer />
    </>
  );
}
